import pytest
from pymrtd import ef
from pymrtd.ef.dg import *


@pytest.mark.depends(
    on=[
        "tests/ef/ef_base_test.py::test_ef_base",
        "tests/ef/dg_base_test.py::test_dg_base",
    ]
)
def test_dg2():
    assert issubclass(ef.DG2, ef.DataGroup)

    # Test vector taken from German BSI TR-03105-5 ReferenceDataSet
    # https://www.bsi.bund.de/SharedDocs/Downloads/DE/BSI/Publikationen/TechnischeRichtlinien/TR03105/BSI_TR-03105-5_ReferenceDataSet_zip.html
    # Datagroup2.bin
    tv_dg2 = bytes.fromhex(
        ""
    )
    dg2 = ef.DG2.load(tv_dg2)
    assert dg2.dump() == tv_dg2
    assert dg2.fingerprint == "A9A1B09DFD598087"
    assert dg2.tag == 21
    assert dg2.number == DataGroupNumber(2)
    assert dg2.portrait.nr_images == 1
    assert dg2.portrait.version_number == 808529920
    assert dg2.portrait.length_of_record == 15045
    assert dg2.portrait.number_of_facial_images == 1
    assert dg2.portrait.facial_record_data_length == 15031
    assert dg2.portrait.nr_feature_points == 0
    assert dg2.portrait.gender == 0
    assert dg2.portrait.eye_color == 0
    assert dg2.portrait.hair_color == 0
    assert dg2.portrait.feature_mask == 0
    assert dg2.portrait.expression == 0
    assert dg2.portrait.pose_angle == 0
    assert dg2.portrait.pose_angle_uncertainty == 0
    assert dg2.portrait.face_image_type == 1
    assert dg2.portrait.image_data_type == 1
    assert dg2.portrait.image_width == 337
    assert dg2.portrait.image_height == 449
    assert dg2.portrait.image_color_space == 0
    assert dg2.portrait.source_type == 0
    assert dg2.portrait.device_type == 0
    assert dg2.portrait.quality == 0
    assert (
        dg2.portrait.image_data
        == ""
    )
